window.bookSummaryJSON = "<p>The disappearance of a routine patrol has the humans scrambling for answers as they investigate the possibility of a new Phaser weapon. Research back on Earth uncovers a technology native to the inhabitants of Reaper's World that has far-reaching implications for the future of all Artificial Lifeforms on Earth and in space.</p> <p>Finally, to add to all General Jake Thomas has on his plate, a fundamental change in his relationship with ALICE could land his personal life on its ear and upset a decade of stability all in one swoop.</p>"; 
